.tab-bar {
  height: 43px;
  background: #222222;
  box-shadow: inset 0 -8px 8px -4px rgba(0, 0, 0, 0.15);
  padding: 0 13px 0 10px;
  box-sizing: border-box;
}
.tab-bar:after {
  content: "";
  position: absolute;
  bottom: 0;
  height: 8px;
  left: 0px;
  width: 100%;
  background-color: #222222;
  border-top: 1px solid #484848;
  border-bottom: 1px solid #111111;
}
.tab-bar .tab {
  position: relative;
  top: 5px;
  height: 30px;
  line-height: 30px;
  color: #aaaaaa;
  padding-left: 0;
  margin-left: 15px;
  border-top-right-radius: 3px;
  box-shadow: inset -1px -1px 1px rgba(0, 0, 0, 0.05);
  -webkit-transform: skewX(30deg);
  transition: color 0.1s ease-in;
  box-shadow: inset -1px 1px 0 #484848, 4px 0px 4px rgba(0, 0, 0, 0.1);
  border: none;
}
.tab-bar .tab,
.tab-bar .tab:before {
  background-image: -webkit-linear-gradient(top, #454545, #333333);
}
.tab-bar .tab:before {
  content: '';
  position: absolute;
  top: 0;
  left: -18px;
  height: 30px;
  width: 40px;
  border-top-left-radius: 3px;
  -webkit-transform: skewX(133deg);
  box-shadow: inset 1px 1px 0 #484848, -4px 0px 4px rgba(0, 0, 0, 0.1);
  border: none;
}
.tab-bar .tab .close-icon {
  z-index: 3;
  line-height: 30px;
  -webkit-transform: skewX(-30deg);
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  top: 12px;
  right: 14px;
  width: 8px;
  height: 8px;
}
.tab-bar .tab .title {
  -webkit-transform: skewX(-30deg);
}
.tab-bar .tab:first-child {
  margin-left: 20px;
}
.tab-bar .tab.active {
  z-index: 10;
  line-height: 27px;
  color: #ffffff;
  box-shadow: inset -1px 1px 0 #484848, 4px -4px 4px rgba(0, 0, 0, 0.1);
  border: none;
}
.tab-bar .tab.active .title {
  position: relative;
  top: 1px;
}
.tab-bar .tab.active .close-icon {
  line-height: 29px;
}
.tab-bar .tab.active,
.tab-bar .tab.active:before {
  background-image: -webkit-linear-gradient(top, #343434, #222222);
  height: 31px;
}
.tab-bar .tab.active:before {
  border: none;
  box-shadow: inset 1px 1px 0 #484848, -4px -4px 4px rgba(0, 0, 0, 0.1);
}
.tab-bar .tab:hover {
  color: #ffffff;
}
.tab-bar .tab.active:hover .close-icon {
  color: #ffffff;
}
